def binary_to_hex(binary_str: str) -> list[str]:
    """
    Converts a binary string to a list of hexadecimal strings.
    Each group of 8 bits is converted to a 2-digit hexadecimal value.
    """
    # Split the binary string into groups of 8 bits
    bin_groups = [binary_str[i:i + 8] for i in range(0, len(binary_str), 8)]

    # Convert each group of binary to hexadecimal
    hex_groups = [format(int(b, 2), '02X') for b in bin_groups]

    return hex_groups


if __name__ == "__main__":
    # Example usage
    binary_str = (
        ""
    )

    hex_result = binary_to_hex(binary_str)
    print(" ".join(hex_result))